/* Animacion del logo viejo */

// se acopla con el div contenedor
// esta funcion de jquery garantiza que la animacion solo corre si se ha cargado la pagina 
$(window).bind("load", function() { //completamente

    var draw = SVG('logo_canvas').size('100%', '100%')
    
    
    draw.svg(oldLogo_Raw)// se dibuja el viejo logo
    
    svg_old = SVG.get(svg_old_id) // instancia del contenedor svg del viejo logo
    svg_old.attr({width:'100%', height:'100%'})
    svg_old.style('width:100%; height:100%;')
    
    grupo_old = SVG.get(old_grupo_id) // instancia del contenedor svg del viejo logo
    grupo_old.attr({opacity:0}) // se pone transparente el logo viejo
    
    grupo_old.animate(1500, '-', 2000).attr({opacity:1})
    grupo_old.animate(2000, '-', 3500).attr({opacity:0}).afterAll(function(){
        grupo_old.remove();
    })
    
    
    /* Animacion del logo nuevo */
    
    draw.svg(rawLogoNew) // se dibuja el nuevo logo
    
    // se obtiene el objeto grupo que le puse el id olgLogo_group despues de editar con ink scape
    // var grupo_new = SVG.get(grupo_new_id)
    var curva = SVG.get(curva_id)
    var texto = SVG.get(texto_id)
    
    
    var svg_new = SVG.get(svg_new_id)
    
    svg_new.attr({width:'100%', height:'100%'})
    svg_new.style('width:100%; height:100%;')
    
    
    curva.attr({'stroke-dasharray':2500, 'stroke-dashoffset':2500, stroke:'#ff3400'})
    texto.attr({opacity:0})
    
    curva.animate(3000, '-', 8700).attr({'stroke-dashoffset':0})
    //curva.animate(1500, '-', 0).attr({stroke:'#ffffff'})
    //curva.animate(3000, '-', 0).attr({'stroke-dashoffset':2500 })
    //curva.animate(3000, '-', 0).attr({'stroke-dashoffset':0, stroke:'#a100ff'})
    //curva.animate(3000, '-', 0).attr({'stroke-dashoffset':2500, })
    //curva.animate(3000, '-', 0).attr({'stroke-dashoffset':0, stroke:'#ff0000'})
    curva.animate(1500, '-', 0).attr({stroke:'#00ffff'}).loop(true, true)
    
    
    texto.animate(2200, '-', 9500).attr({opacity:1})
    
});